import './App.css';
import axios from 'axios';

var ver;

var hey = async (e) => {
  e.pre
  axios.get('http://localhost:4000/penis')
  .then(res => {
    ver = JSON.stringify(res.data.hi);
    console.log('res: '+ JSON.stringify(res.data.hi));
  })
};

hey()

